import "assets/styles/login.scss"
import { NextPage } from "next"
import dynamic from "next/dynamic"
import { memo, useCallback } from "react"
import { useDispatch, useSelector } from "react-redux"
import { login } from "services/auth/actions"
import { AuthSelector } from "services/auth/selectors"

const LoginForm = dynamic(() => import("components/LoginForm"))

const Login: NextPage = () => {
  const dispatch = useDispatch()
  const { loading } = useSelector(AuthSelector)

  const handleSubmit = useCallback(
    (params: Record<"email" | "password", string>) => dispatch(login(params)),
    [dispatch]
  )

  return (
    <div className="login">
      <div className="container wrap-login">
        <div className="header-contain">
          <h4 className="header">Guardian</h4>
          <h4>Log in to be a guardian of our vessels</h4>
          <br />
        </div>
        <LoginForm onSubmit={handleSubmit} loading={loading} />
      </div>
    </div>
  )
}

export default memo(Login)
